tinsert(l,m(248,g({isRaid=1,description="Onyxia is the daughter of the mighty dragon Deathwing, and sister of the scheming Nefarian, Lord of Blackrock Spire.\n\nIt is said that Onyxia delights in corrupting the mortal races by meddling in their political affairs. To this end it is believed that she takes on various humanoid forms and uses her charm and power to influence delicate matters between the different races. Some believe that Onyxia has even assumed an alias once used by her father - the title of the royal House Prestor. When not meddling in mortal concerns, Onyxia resides in a fiery cave below the Dragonmurk, a dismal swamp located within Dustwallow Marsh. There she is guarded by her kin, the remaining members of the insidious black dragonflight.",coords={{52.3,76.2,1445}},sourceQuests={6502,6602},lvl=60},{n(-17,{q(7635,g({c=a3,cost={{"i",18705,1}},qgs={14525},coords={{47,24.48,1448}},lvl=60,sourceQuests={7633}},{i(18724)})),q(7634,g({c=a3,cost={{"i",18704,1}},lvl=60,qgs={14526},coords={{47,24.48,1448}},crs={6109,7435,7436,7437},sourceQuests={7633}},{i(18714)})),q(7496,g({races=a1,sourceQuests={7495},lvl=60,qgs={1748}},{i(18403),i(18406),i(18404)})),q(7491,g({races=a2,sourceQuests={7490},lvl=60,qgs={4949}},{i(18403),i(18404),i(18406)})),q(7507,g({maps={-1},description="You get this quest by looting Foror's Compendium from bosses in Dire Maul.\n\nYou can also buy it on the Auction House for a hefty price!",c=a15,lvl=60,qgs={14368}},{i(18513)})),q(7636,g({c=a3,cost={{"i",18955,1},{"i",18953,1},{"i",18952,1},{"i",18954,1}},description="You must defeat the 4 demons listed below by yourself with no pet in order to complete this quest.",coords={{47,24.48,1448}},lvl=60,qgs={14524}},{n(14535,g({description="Kite him using Aspect of the Cheetah. Keep Serpent Sting on at all times and use Concussive Shot whenever he gets close. It is important to remain beyond 30 yards of the Demonic Doom, yet within range to use Arcane Shot so that he continues chasing you. If you rely completely on Serpent Sting for damage, he will break aggro and return to where he started. Once you apply Serpent Sting, count to 4, and apply it again before it wears off (the damage does stack). You will be able to see this by a 2nd damage listing \"Stinging Trauma\", which will continue to increase each time the sting is applied.\n\nBe sure to clear the area you plan on fighting so as to not get dazed by another NPC wandering by.\n\nLocated in Winterspring.",coords={{60.3,13.2,1452}},crs={14531}},{i(18955)})),n(14534,g({description="Use Concussive Shot/Serpent Sting to kite him down the road. You should know how long serpent sting lasts, use only one per trip down the road, more if you think you can risk it. As soon as it's worn off, drop an ice trap, let him stand in it, go to the other side, max range, and start again. If for whatever reason he breaks trap, you can use scatter shot, or use concussive shot to just keep kiting him in a circle until the cooldown finishes.\n\nDo not worry about his enrage, because he won't be touching you at all if you play right.\n\nLocated in the Burning Steppes.",coords={{25.3,65.9,1428}},crs={14529}},{i(18953)})),n(14533,g({description="There are two things that can make this fight difficult: her pet, a felhound named Precious and low nature resistance. Most hunters tend to CC Precious by freeze trapping it. Using ranged attacks is useless because she casts a debuff that substantially lowers ranged attack power. Your best bet is to use aspect of the wild + a greater nature protection potion (to dull and absorb her lightning bolts) and melee her until she falls.\n\nLocated in Ungoro Crater.",coords={{34.5,41.1,1449}},crs={14527}},{i(18952)})),n(14530,g({description="This is the hardest demon:\n\nStrengths:\n* He does NOT predictably chase you. He frequently stops to fear (disorienting you and causing around 800 damage also) or will stop to shoot homing beetles at you.\n* The homing beetles basically prevent you from bandaging. They move extremely slow but hit extremely hard\n* If you leave melee range (further than 2-3 range or so), he uses an instant cast fear spell that also does 700-800 damage instantly, and he can cast these quickly, almost seemingly chain casting. Shadow protection potions do absorb this damage, however, even with greater potions, he tears through them very fast. It's also likely that the fear will send you into the homing beetles\n* Seemingly unlimited mana bar, so Viper Sting is useless\n* Scorpid sting has very little/no effect on him\n* Melees extremely hard and fast (200+) when in normal form\n\nWeaknesses:\n* If you use Rank 3 Wing Clip on him, it immobilizes him completely with \"Crippling Clip\" for 30 seconds.\n* The homing missiles (creepings) are not fired when you remain in melee range\n* He does NOT cast his fear when you remain in melee range\n* Must be 'chilled' via Frost Trap prior to fully engaging\n\nLocated in Silithus.",coords={{24.7,76,1451}},crs={14536}},{i(18954)})),i(18707,g({cost={{"i",18724,1}}},{i(18713)})),i(18715,{c=a3,sourceQuests={7634,7635,7636},description="Go back to Felwood after having completed all the quests and a chat icon will become available, allowing you to interact with one of the ancients. Speak to him and he will give you the staff."})})),q(7508,{maps={-1},c=a15,qgs={14368},cost={
