tinsert(l,m(226,g({lvl=19,description="Located in Dun Morogh, the technological wonder known as Gnomeregan has been the gnomes' capital city for generations. Recently, a hostile race of mutant troggs infested several regions of Dun Morogh - including the great gnome city. In a desperate attempt to destroy the invading troggs, High Tinker Mekkatorque ordered the emergency venting of the city's radioactive waste tanks. Several gnomes sought shelter from the airborne pollutants as they waited for the troggs to die or flee. Unfortunately, though the troggs became irradiated from the toxic assault - their siege continued, unabated. Those gnomes who were not killed by noxious seepage were forced to flee, seeking refuge in the nearby dwarven city of Ironforge. There, High Tinker Mekkatorque set out to enlist brave souls to help his people reclaim their beloved city.\n\nIt is rumored that Mekkatorque's once-trusted advisor, Mekgineer Thermaplug, betrayed his people by allowing the invasion to happen. Now, his sanity shattered, Thermaplug remains in Gnomeregan - furthering his dark schemes and acting as the city's new techno-overlord."},{n(-17,{q(2904,g({races=a1,lvl=20,qgs={7850}},{i(9536),i(9535)})),q(2931,{maps={1442},races=a1,coords={{59.6,67,1442}},lvl=25,qgs={4077}}),q(2842,{maps={1454},races=a2,description="You cannot get this quest until you accept the Rig Run quest. Accept Rig Run, then this guy gives you the quest to get to Gnomer safely...",coords={{75.6,25.2,1454}},lvl=20,qgs={3413}}),q(2930,g({maps={1455},races=a1,qgs={7950},coords={{70.2,48.4,1455}},lvl=25,sourceQuests={2931}},{i(9604),i(9605)})),q(2924,{maps={1455},races=a1,qgs={6169},coords={{68.2,46.2,1455}},lvl=24,sourceQuests={2925}}),q(2926,{maps={1426},races=a1,qgs={1268},coords={{45.8,49.2,1426}},lvl=20,sourceQuests={2927}}),q(2948,g({maps={1455},races=a1,cost={{"i",9362,1},{"i",2842,1},{"i",1206,1},{"g",3000}},lvl=28,qgs={6826},coords={{36.2,3.8,1455}},sourceQuests={2947}},{i(9538)})),q(2843,{maps={143