tinsert(l,m(213,g({description="Ragefire Chasm consists of a network of volcanic caverns that lie below the orcs' new capital city of Orgrimmar. Recently, rumors have spread that a cult loyal to the demonic Shadow Council has taken up residence within the Chasm's fiery depths. This cult, known as the Burning Blade, threatens the very sovereignty of Durotar. Many believe that the orc Warchief, Thrall, is aware of the Blade's existence and has chosen not to destroy it in the hopes that its members might lead him straight to the Shadow Council. Either way, the dark powers emanating from Ragefire Chasm could undo all that the orcs have fought to attain",coords={{50.6,51.6,1454}},lvl=13},{n(-17,{q(5726,{maps={1454},races=a2,coords={{32,37.8,1454}},lvl=9,qgs={4949}}),q(5727,{maps={1454},races=a2,sourceQuests={5726},coords={{32,37.8,1454}},lvl=9,qgs={4949}}),q(5728,{maps={1454},races=a2,sourceQuests={5727},coords={{32,37.8,1454}},lvl=9,qgs={4949}}),q(5729,{maps={1454},races=a2,sourceQuests={5728},coords={{32,37.8,1454}},lvl=9,qgs={4949}}),q(5730,g({maps={1454},races=a2,sourceQuests={5729},coords={{49.6,50.6,1454}},lvl=9,qgs={3216}},{i(15424),i(15445),i(15443),i(15444)})),q(5724,g({races=a2,sourceQuests={5722},lvl=9,qgs={11834}},{i(15452),i(15453)})),q(5722,{maps={1456},races=a2,coords={{70.6,31.4,1456}},lvl=9,qgs={11833}}),q(5761,{maps={1454},races=a2,sourceQuests={5727},coords={{49.6,50.6,1454}},lvl=9,qgs={3216}}),q(5723,{maps={1456},races=a2,coords={{70.6,31.4,1456}},lvl=9,qgs={11833}}),q(5725,g({maps={1458},races=a2,coords={{56.2,91.8,1458}},lvl=9,qgs={2425}},{i(15450),i(15451),i(15449)}))}),n(11517,{i(2589)}),n(11520,{i(14540),i(14145),i(14149),i(14148)}),n(11518,{i(14151),i(14150),i(14147)}),n(11519,{description="Drops nothing of note."})})));
tinsert(l,m(300,g({description="Crafted from the same mighty vines as Razorfen Kraul, Razorfen Downs is the traditional capital city of the quillboar race. The sprawling, thorn-ridden labyrinth houses a veritable army of loyal quillboar as well as their high priests - the Death's Head tribe. Recently, however, a looming shadow has fallen over the crude den. Agents of the undead Scourge - led by the lich, Amnennar the Coldbringer - have taken control over the quillboar race and turned the maze of thorns into a bastion of undead might. Now the quillboar fight a desperate battle to reclaim their beloved city before Amnennar spreads his control across the Barrens.",coords={{50,92,1413}},lvl=25},{n(-17,{q(6626,{maps={1413},coords={{49,94,1413}},lvl=28,qgs={12866}}),q(3341,g({maps={1458},races=a2,coords={{74,32.8,1458}},lvl=37,qgs={2308}},{i(10823),i(10824)})),q(3636,g({maps={1453},races=a1,coords={{39.6,27.4,1453}},lvl=39,qgs={1284}},{i(10823),i(10824)})),q(3525,g({races=a2,qgs={8516},lvl=32,sourceQuests={3523}},{i(10710)})),q(3523,{races=a2,lvl=32,qgs={8516}})}),n(0,{i(10573),i(10582),i(10574),i(10581),i(10571),i(10572),i(10570),i(10567),i(10583),i(10584),i(10578)}),n(7355,{i(10776),i(10775),i(10777)}),n(7356,{i(10766),i(10760)}),n(8696,g({description="The only source of acquiring Goldthorn Tea."},{r(13028)})),n(7357,{i(10770),i(10769),i(10771)}),n(7354,g({description="This is a rare spawn that is not always present."},{i(10758),i(10767),i(10768)})),n(8567,{i(10772),i(10774)}),n(7358,{i(10420,{questID=3341,races=a2}),i(10761),i(10763),i(10764),i(10762),i(10765)}),n(14686,g({u=2,description="Only available during the Scourge Invasion."},{i(23177,{u=2}),i(23178,{u=2})}))})));
tinsert(l,m(301,g({description="Ten thousand years ago - during the War of the Ancients, the mighty demigod, Agamaggan, came forth to battle the Burning Legion. Though the colossal boar fell in combat, his actions helped save Azeroth from ruin. Yet over time, in the areas where his blood fell, massive thorn-ridden vines sprouted from the earth. \n\nThe quillboar - believed to be the mortal offspring of the mighty god, came to occupy these regions and hold them sacred. The heart of these thorn-colonies was known as the Razorfen. The great mass of Razorfen Kraul was conquered by the old crone, Charlga Razorflank. Under her rule, the shamanistic quillboar stage attacks on rival tribes as well as Horde villages. Some speculate that Charlga has even been negotiating with agents of the Scourge - aligning her unsuspecting tribe with the ranks of the Undead for some insidious purpose.",coords={{40.94,94.55,1413}},lvl=17},{n(-17,{q(1102,g({maps={1456},races=a2,coords={{37.1,29,1412}},lvl=29,qgs={4451}},{i(6725),i(4197),i(6742)})),q(6522,{maps={1458},races=a2,coords={{56.3,92.2,1458}},lvl=28,qgs={2425}}),q(6521,g({maps={1458},races=a2,qgs={2425},coords={{56.3,92.2,1458}},lvl=28,sourceQuests={6522}},{n(12865,g({coords={{48.6,95.6,1413}}},{i(17009)})),i(17039),i(17042),i(17043)})),q(1221,g({maps={1413},races=a2,coords={{62.4,37.6,1413}},lvl=20,qgs={3446}},{i(5880),i(5897),i(6684),i(6755,{i(6756)})})),q(1109,{maps={1458},races=a2,coords={{49,69.8,1458}},lvl=30,qgs={2055}}),q(1142,g({races=a1,coords={{69.4,67.6,1438}},lvl=25,qgs={4510}},{i(6751),i(6752)})),q(1101,g({maps={1444},races=a1,qgs={4048},coords={{89.6,46.6,1444}},lvl=29,sourceQuests={1100}},{i(6725),i(4197),i(6742),i(3041)})),q(1144,g({lvl=22,qgs={4508}},{i(6748),i(6750),i(6749)}))}),n(0,{i(5876,{races=a2,description="Acquired by using the Snufflenose Command Stick after releasing a gopher using the Crate With Holes."}),i(5801,{races=a2}),i(5825,{races=a1}),i(1488),i(2264),i(2039),i(4438),i(1975),i(1976),i(2549),i(1727)