tinsert(l,m(225,g({description="The Stockade is a high-security prison complex, hidden beneath the canal district of Stormwind city. Presided over by Warden Thelwater, the Stockade is home to petty crooks, political insurgents, murderers and a score of the most dangerous criminals in the land. Recently, a prisoner-led revolt has resulted in a state of pandemonium within the stockade - where the guards have been driven out and the convicts roam free. Warden Thelwater has managed to escape the holding area and is currently enlisting brave thrill-seekers to venture into the prison and kill the uprising's mastermind - the cunning felon, Bazil Thredd.",coords={{39.77,54.21,1453}},lvl=15},{n(-17,{q(377,g({maps={1431},races=a1,coords={{72,46.8,1431}},lvl=26,qgs={270}},{i(2906),i(2033)})),q(387,{maps={1453},races=a1,coords={{39.77,54.21,1453}},lvl=22,qgs={1719}}),q(388,{maps={1453},races=a1,coords={{73.2,55.2,1453}},lvl=22,qgs={1721}}),q(378,g({maps={1437},races=a1,coords={{49.8,18.2,1437}},lvl=25,qgs={1074}},{i(1264),i(3562)})),q(391,{maps={1453},races=a1,sourceQuests={389},coords={{39.77,54.21,1453}},lvl=16,qgs={1719}}),q(386,g({maps={1433},races=a1,coords={{26,43,1433}},lvl=22,qgs={859}},{i(1317),i(3400)}))}),n(0,{i(1076)}),n(1720,g({description="This is a rare that was not always present."},{i(2942),i(3228),i(2941),i(4306)})),n(1666,{i(3640),i(2280),i(4306)}),n(1663,{i(3628),i(2909),i(4306)}),n(1717,{i(4306)}),n(1696,{i(3630),i(2592)}),n(1716,{i(2926),i(2909),i(4306)})})));
tinsert(l,m(220,g({lvl=45,description="Over a thousand years ago, the powerful Gurubashi Empire was torn apart by a massive civil war. An influential group of troll priests, known as the Atal'ai, attempted to bring back an ancient blood god named Hakkar the Soulflayer. Though the priests were defeated and ultimately exiled, the great troll empire buckled in upon itself. The exiled priests fled far to the north, into the Swamp of Sorrows. There they erected a great temple to Hakkar - where they could prepare for his arrival into the physical world. The great dragon Aspect, Ysera, learned of the Atal'ai's plans and smashed the temple beneath the marshes. To this day, the temple's drowned ruins are guarded by the green dragons who prevent anyone from getting in or out. However, it is believed that some of the fanatical Atal'ai may have survived Ysera's wrath - and recommitted themselves to the dark service of Hakkar."},{n(-17,{q(9053,g({c=a11,u=3,providers={{"n",9619}}},{i(22272),i(22274),i(22458)})),q(8257,g({c=a7,u=3,providers={{"n",8405}}},{i(19990),i(20006),i(20082)})),q(8413,g({c=a10,u=3,providers={{"n",6176}}},{i(20369),i(20503),i(20556)})),q(8253,g({c=a9,u=3,providers={{"n",8379}}},{i(20037),i(20036),i(20035)})),q(8418,g({c=a6,races=a1,u=3,providers={{"n",10838}}},{i(20505),i(20504),i(20512)})),q(8236,g({c=a4,u=3,providers={{"n",8379}}},{i(19982),i(19984),i(20255)})),q(8232,g({c=a3,u=3,providers={{"n",8405}}},{i(19991),i(19992),i(20083)})),q(8422,g({c=a8,u=3,providers={{"n",14470}}},{i(20534),i(20530),i(20536)})),q(8425,g({c=a5,u=3,providers={{"n",7572}}},{i(20130),i(20521),i(20517)})),q(4143,{maps={1444},races=a1,qgs={7775},coords={{45.1,25.6,1444}},lvl=47,sourceQuests={4142}}),q(3512,{maps={1435},qgs={5353},description="This quest chain seems to be an incomplete one as there is no follow-up. Still an interesting quest chain as most people do not know about it. It essentially details how Eranikus is not actually dead and likely prepares the player for the Openi