tinsert(l,m(279,g({description="Recently, a night elf druid named Naralex discovered a network of underground caverns within the heart of the Barrens. Dubbed the 'Wailing Caverns', these natural caves were filled with steam fissures which produced long, mournful wails as they vented. Naralex believed he could use the caverns' underground springs to restore lushness and fertility to the Barrens - but to do so would require siphoning the energies of the fabled Emerald Dream.\n\nOnce connected to the Dream, however, the druid's vision somehow became a nightmare. Soon the Wailing Caverns began to change - the waters turned foul and the once-docile creatures inside metamorphosed into vicious, deadly predators. It is said that Naralex himself still resides somewhere inside the heart of the labyrinth, trapped beyond the edges of the Emerald Dream. Even his former acolytes have been corrupted by their master's waking nightmare - transformed into the wicked Druids of the Fang.",coords={{45.9,35.7,1413}},lvl=10},{n(-17,g({description="To get to the quest giver hub outside the instance:\n\nWhen facing the mouth of the cave, you should see that the entrance looks like a skull. The questgivers are in the left eye. To get there, climb up the mountain, drop onto the head, drop onto the brow, drop onto the nose, face the instance, and go into the eye on the left"},{q(1487,g({maps={1413},coords={{46,35.7,1413}},lvl=15,qgs={5768}},{i(6476),i(8071),i(6481)})),q(1486,g({maps={1413},coords={{46,35.7,1413}},lvl=13,qgs={5767}},{i(6480),i(918)})),q(1489,{maps={1413},races=a2,qgs={3448},coords={{52.3,31.9,1413}},lvl=10,sourceQuests={880}}),q(3370,g({maps={1413},lvl=15,qgs={8418},description="She lives in a house on top of the mountain.",coords={{48.2,32.8,1413}},sourceQuests={6981},altQuestID=3369},{i(10657),i(10658)})),q(914,g({maps={1412,1456},races=a2,qgs={5770},coords={{45.2,23.3,1412},{75,31,1456}},lvl=10,sourceQuests={1490}},{i(6505),i(6504)})),q(1490,{maps={1412,1456},races=a2,qgs={5