tinsert(l,m(219,g({description="Troll legends tell of a powerful sword called Sul'thraze the Lasher, a weapon capable of instilling fear and weakness in even the most formidable of foes. Long ago, the weapon was split in half. However, rumors have circulated that the two halves may be found somewhere within Zul'Farrak's walls. Reports have also suggested that a band of mercenaries fleeing Gadgetzan wandered into the city and became trapped. Their fate remains unknown. But perhaps most disturbing of all are the hushed whispers of an ancient creature sleeping within a sacred pool at the city's heart - a mighty demigod who will wreak untold destruction upon any adventurer foolish enough to awaken him.",coords={{39,19,1446}},lvl=39},{n(-17,{q(2768,g({maps={1446},coords={{52.5,28.5,1446}},lvl=40,providers={{"n",7407}}},{i(9534),i(9533)})),q(2770,g({maps={1441},coords={{78,77,1441}},lvl=40,providers={{"n",4453}}},{i(11122,{description="Do NOT vendor this item. Keep it with you always. It is best-in-slot when you are traveling long distances on your mount. (which you do a lot in Classic!)"})})),q(2991,{maps={1419},races=a1,coords={{67,19.4,1419}},lvl=40,providers={{"n",8022}}}),q(2865,{maps={1446},providers={{"n",7876}},coords={{51.6,26.8,1446}},lvl=40,sourceQuests={2864}}),q(3520,{maps={1444,1446},coords={{67,22.4,1446}},lvl=40,providers={{"n",8579}}}),q(3527,{maps={1446},providers={{"n",8579}},coords={{67,22.4,1446}},lvl=40,sourceQuests={3520}}),q(2936,{maps={1411},races=a2,providers={{"n",3188}},coords={{56,74.6,1411}},lvl=40,sourceQuests={2935}}),q(2846,g({maps={1445},coords={{46,57,1445}},lvl=40,providers={{"n",6546}}},{i(9527),i(9531)})),q(2864,{maps={1434},lvl=40,coords={{51.6,26.8,1434}},isBreadcrumb=1,providers={{"n",773}}}),q(3042,{maps={1446},coords={{51.4,28.8,1446}},lvl=40,providers={{"n",7804}}})}),n(-77,{i(9240,{description="The Sacred Mallet drops from Qiaga the Keeper on top of the Altar of Zul in Hinterlands. You then bring it to the top of Jintha'alor an